% exact
plot(exact_0(1:samples),'r-');
hold on;
plot(exact_1(1:samples),'m-');
plot(exact_2(1:samples),'b-');
plot(exact_3(1:samples),'g-');
plot(exact_4(1:samples),'k-');


% empty
plot(blank_0(1:samples),'r-o');
plot(blank_1(1:samples),'m-o');


% patterns
plot(pattern_0(1:samples),'r-+');
plot(pattern_1(1:samples),'m-+');
plot(pattern_2(1:samples),'b-+');


% trash
plot(trash_0(1:samples),'r-*');
plot(trash_1(1:samples),'m-*');
plot(trash_2(1:samples),'b-*');


%plot(sad_blank,'b-');
%plot(sad_repeat,'m-');
%xlabel('ordered location');
%ylabel('sad score');
%title('sad score for needle in haystack');
%legend('unique','blank','repeat');




